// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/// @title Crypto POS with Rewards + 6 Brand Coupons
/// @notice Handles NFC-based payments, reward points, and coupon generation
contract CryptoPOSWithCoupons {
    address public owner;

    mapping(address => bool) public approvedTerminals;

    // User (UID) balances and reward points
    mapping(bytes32 => uint256) public balances;
    mapping(bytes32 => uint256) public rewardPoints;

    // Coupon data (6 brands: 0..5)
    mapping(bytes32 => mapping(uint8 => uint256)) public couponBalances; 
    uint8 public constant NUM_COUPONS = 6;

    uint256 public constant REWARD_RATE_DIVISOR = 1e16;

    event TerminalApproved(address indexed terminal, bool approved);
    event Payment(
        bytes32 indexed uid,
        address indexed merchant,
        uint256 amount,
        uint256 rewardEarned,
        address indexed triggeredBy
    );
    event RewardsRedeemed(
        bytes32 indexed uid,
        uint256 pointsRedeemed,
        string serviceId,
        address indexed triggeredBy
    );
    event CouponGranted(
        bytes32 indexed uid,
        uint8 couponType,
        uint256 newBalance
    );
    event CouponRedeemed(bytes32 indexed uid, uint8 couponType, string details);
    event TopUp(bytes32 indexed uid, uint256 amount, address indexed from);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    modifier onlyTerminalOrOwner() {
        require(
            msg.sender == owner || approvedTerminals[msg.sender],
            "Not authorized"
        );
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    /// @notice Set or remove approved terminals
    function setTerminal(address terminal, bool approved)
        external
        onlyOwner
    {
        approvedTerminals[terminal] = approved;
        emit TerminalApproved(terminal, approved);
    }

    /// @notice Add prepaid balance for a specific UID (in POL)
    function topUp(bytes32 uid) external payable {
        require(msg.value > 0, "No funds sent");
        balances[uid] += msg.value;
        emit TopUp(uid, msg.value, msg.sender);
    }

    /// @notice Process a payment, generate reward points & random coupon
    function pay(
        bytes32 uid,
        address payable merchant,
        uint256 amount
    ) external onlyTerminalOrOwner {
        require(balances[uid] >= amount, "Insufficient balance");
        balances[uid] -= amount;

        // Send payment to merchant
        merchant.transfer(amount);

        // Calculate and credit reward points
        uint256 reward = amount / REWARD_RATE_DIVISOR;
        rewardPoints[uid] += reward;

        // Grant random coupon out of 6
        _grantRandomCoupon(uid);

        emit Payment(uid, merchant, amount, reward, msg.sender);
    }

    /// @dev Internal: grants 1 random coupon (0..5)
    function _grantRandomCoupon(bytes32 uid) internal {
        // NOTE: pseudo-randomness only for demo; not for real-money production
        uint8 couponType = uint8(
            uint256(
                keccak256(
                    abi.encodePacked(block.timestamp, msg.sender, uid, block.prevrandao)
                )
            ) % NUM_COUPONS
        );

        couponBalances[uid][couponType] += 1;
        emit CouponGranted(uid, couponType, couponBalances[uid][couponType]);
    }

    /// @notice Redeem earned reward points for an off-chain service
    function redeemRewards(
        bytes32 uid,
        uint256 points,
        string calldata serviceId
    ) external onlyTerminalOrOwner {
        require(rewardPoints[uid] >= points, "Not enough points");
        rewardPoints[uid] -= points;
        emit RewardsRedeemed(uid, points, serviceId, msg.sender);
    }

    /// @notice Redeem a coupon of a specific brand (0..5)
    function redeemCoupon(
        bytes32 uid,
        uint8 couponType,
        string calldata details
    ) external onlyTerminalOrOwner {
        require(couponType < NUM_COUPONS, "Invalid coupon");
        require(couponBalances[uid][couponType] > 0, "No coupon available");

        couponBalances[uid][couponType] -= 1;
        emit CouponRedeemed(uid, couponType, details);
    }

    /// @notice Withdraw POL from the contract (owner only)
    function ownerWithdraw(address payable to, uint256 amount)
        external
        onlyOwner
    {
        require(address(this).balance >= amount, "Insufficient contract balance");
        to.transfer(amount);
    }

    // allow direct POL/MATIC transfers
    receive() external payable {}
    fallback() external payable {}
}

